import './App.css';
import React from 'react';
const carsData = [
  // Sample car data
  // Include more cars as needed
  { id: 1, name: 'Car 1', brand: 'Brand 1' },
  { id: 2, name: 'Car 2', brand: 'Brand 2' },
  // ...
];
function App() {
  return (
    <>
    <div className="App">
      {carsData}
    </div>
    </>
  );
}

export default App;
